package com.noki.app;

import java.util.HashMap;
import java.util.Map;

import org.apache.http.HttpResponse;
import org.apache.http.util.EntityUtils;

import com.noki.app.util.HttpUtils;


public class DlOcrServer extends Thread{
	private String imgStr;
	private String uuid;
	
	public static void main(String[] args) {
	DlOcrServer dls = new DlOcrServer("","");
		dls.start();
	}
	
	public DlOcrServer(String uuid,String imgStr) {
		this.uuid = uuid;
		this.imgStr = imgStr;
	}
	
	@Override
	public void run() {
		getDlByOcr(imgStr);
	}
	
	public String getDlByOcr(String imgStr) {
		//String imageFile_base64 = Img2Base64Util.getImgStr(imageFilePath);
		String dl = "";
		String host = "http://tysbgpu.market.alicloudapi.com";
		String path = "/api/predict/ocr_general";
		String method = "POST";
		String appcode = "0c3f727d0897439fb5746a9c3c3e12fd";
		Map<String, String> headers = new HashMap<String, String>();
		// header()Authorization:APPCODE
		// 83359fd73fe94948385f570e3c139105
		headers.put("Authorization", "APPCODE " + appcode);
		// APIContent-Type
		headers.put("Content-Type", "application/json; charset=UTF-8");
		Map<String, String> querys = new HashMap<String, String>();
		String bodys = "{\"image\":    \""
				+ imgStr
				+ "\", \"configure\":{\"min_size\" : 16,    \"output_prob\" : true }}";
		System.out.println(bodys);
		try {
			/**
			 * : HttpUtils
			 * https://github.com/aliyun/api-gateway-demo-sign
			 * -java/blob/master/src
			 * /main/java/com/aliyun/api/gateway/demo/util/HttpUtils.java 
			 * 
			 * 
			 * https://github.com/aliyun/api-gateway-demo-sign-java/blob
			 * /master/pom.xml
			 */
			HttpResponse response = HttpUtils.doPost(host, path, method,
					headers, querys, bodys);
			// HttpResponse response = HttpUtils.doPost(host, path, method,
			// headers, querys, bodys);
			System.out.println(response.toString());
			// responsebody
			String resultValue = EntityUtils.toString(response.getEntity());
			System.out.println("[response]"+resultValue);
			dl = resultValue;
		} catch (Exception e) {
			e.printStackTrace();
		}

		return dl;
	}
}
